import React, { useState, useEffect } from 'react';
import logo from './bd_logo.png';
import background_img from './open_bg.png';
import './App.css';

var backgroundStyle = {
  width : "100%",
  heith : "400px",
  backgroundImage: background_img
};

class Section extends Component {
  render() {
    return (
      <section style={backgroundStyle}>
      </section>
    );
  }
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        Welcome to Breakdown!
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Welcome to Breakdown!
        </p>
      </header>
    </div>
  );
}

export default App;
